// src/Dashboard.js

import React from 'react';
import './components/App.css';


const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <div className="dashboard-card">
        <h2>Card 1</h2>
        <p>Card content goes here.</p>
      </div>
      <div className="dashboard-card">
        <h2>Card 2</h2>
        <p>Card content goes here.</p>
      </div>
      {/* Add more cards as needed */}
    </div>
  );
};

export default Dashboard;
